trailingComments.value:
*
 * 打开书豆充值页
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @return {Promise<void>}
 *
 * @example
 * libSQ.exec('open-recharge-page').catch((err) => {
 *   alert(`[open-recharge-page][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail;
 *   alert(e);
 * });

